[[File:John Dramani Mahama UNDP 2010.jpg|thumb|right|John Mahama, Ghana dukplɔla]] '''John Dramani Mahama''' si wodzi 29 Adeɛmekpɔxe 1958 enye [[Ghana]] dukɔa ƒe dziɖula tso Siamlɔm 24 2012. Wotiae le [[John Atta Mills]] ƒe kuku megbe ŋkeke ma.
{{Ghana dukplɔlawo}}
