[[Category:1958 vidzidziwo|Mahama, John]] [[Category:Ghanatɔwo|Mahama, John]] [[Category:Ghana dukplɔlawo|Mahama, John]]

[[File:Keta beach.jpg|thumb|260px|<font color="black">[[Fort Prinsensten]] si le Keta ƒugodzi le ƒe 1985</font>]] [[File:Fort Prinzenstein 02.JPG|thumb|260px|<font color="black">[[Fort Prinsensten]] ƒe ŋkume le 2012 me</font>]]
'''Keta''' nye du aɖe si le Volta alo Amuga nutome le [[Ghana]]. Enye toxɔ du na [[Keta Municipal District]]. Keta nye teƒe tɔxɛ aɖe na asitsatsa le senturi wuienelia kple blaevelia ƒe nuwuwu me, ɖe meli dzeƒe kple xɔ si Dutch yevuwo tu le 1784 ɖe Keta la. Atsiaƒu ɖe dua ƒe akpa aɖewo tso ƒe 1960 va seɖe 1980. Keta nye du bladevɔ-etɔ̃lia le du si me amewo sɔ gbɔ le Ghana la me, Amewo ƒe agbɔsɔsɔmee nye 22,739.
==Nya siawo tsoƒe== [http://en.wikipedia.org/wiki/Keta Kpɔ Keta le English Wikipeɖia dzi]
