'''Denu''' nye du sue aɖe si nye toxɔdu ne Ketu Anyiehe distrikt, distrikt si le anyiehe-ɣedzeƒe lɔƒo ne Volta alo Amuga nutoame, e si me didi fũ tso [[Ghana]] kple [Togo]] ƒe liƒo dzi o.


